import React from "react";
import "../css/Footer.css";
export default function Footer() {
  return (
    <div className="footer">
      <p className="footer-text">Powered by </p>
      <p className="footer-link">
        <a href="https://openweathermap.org/" target="_blank">
          OpenWeatherMap
        </a>
      </p>
    </div>
  );
}
